window.bookSummaryJSON = "<p>I’ve spent five years in hell, chained up by a man who was supposed to love me.</p> <p>My family thinks I’m dead. I would be, if it weren’t for the little boy born into a nightmare. I breathe only for him.</p> <p>Until Zane walks back into my life.</p> <p>My brother-in-law. The teenager I once knew, now all grown-up.</p> <p>He’s a prisoner, just as I am.</p> <p>I don’t trust him—but I have no one else.</p> <p>Night by night, hidden away in the darkness, he comes to me, whispering hope in my ear.</p> <p>Setting my body alight with his touch.</p> <p>If his brother knew, he’d kill us both.</p> <p>But neither of us can stop. The forbidden attraction turning into a secret romance we can’t give up.</p> <p>Until there’s only one way out.</p> <p>Escape.</p> <p>A caged bird needs to be set free.</p> <p>Caged Bird is a dark, forbidden romance with an abused, single mom heroine and the brother-in-law who’s loved her since they were kids.</p> <p>Please check the trigger warnings. Caged Bird can be listened to as a standalone romance but is best listened to as book four in the Saint View Strip series.</p>"; 
